import React, { useEffect, useState } from 'react'
import './Home.css';

export default function Home() {
  let [product,setProduct] = useState(null)
  useEffect(()=> {
    
      fetch("https://assessment.api.vweb.app/rides")
      .then((response) => response.json())
      .then((data)=> {
        setProduct(data);
      })
      
    
  },[])
  
  console.log(product);
  if(product) {
    return (
      <>
          {product.map((item) => {
            return (
              <>
              <img src={item.map_url} alt="" />
              <div className='ride_id'> Ride id :
                {item.id}
              </div>
              <div className='origin_station'>Origin Station : {item.origin_station_code} </div>
              <div className="station_container">
              <span  className='station_path'>station_path : 
                {item.station_path.map((x)=> {
                  return (<sa className='station_path_no'>{x}</sa>)
                })}
              </span>
              </div>
              
              <div className='date'>Date : {item.date}</div>
              </>
            )
          })
        } 
      </>
    )
    }
}
